import React from "react";
import logo from "./logo.svg";
import "./App.css";
import TNode from "./Components/TNode";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <code>Pathfinding Visualiser</code>
        </p>
        <div></div>
        <TNode></TNode>
      </header>
    </div>
  );
}

export default App;
